import React, { useState, useEffect } from "react";
import { domain } from "../config";

const Menu = () => {
  const [list, setList] = useState([]);
  useEffect(async () => {
    try {
      const doWork = await fetch(`${domain}/`);
    } catch (err) {
      throw err;
    }
  }, []);
  return (
    <div>
      <div>Menu Page</div>
      <div>
        <table style={{ width: "100%" }}>
          <tbody>
            <tr>
              <th>No.</th>
              <th>Name</th>
              <th>Description</th>
              <th>Price</th>
              <th>Active</th>
              <th></th>
              <th></th>
            </tr>

            {list.map((item) => {
              <tr key={item.id}>
                <td>Update</td>
                <td>Delete</td>
              </tr>
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Menu;
